script: |
  super -f text -I q10491.spq | sort > q10491.out

inputs:
  - name: q10491.spq
    data: |
      SELECT col2 FROM tab1 (FORMAT parquet) cor0 WHERE NOT + col1 BETWEEN ( - + CAST ( + col0 AS INTEGER ) - + col1 ) AND - ( - 11 );
  - name: tab1

outputs:
  - name: q10491.out
    data: |
      68
      96
